/**
 * 精确乘法，支持多个数相乘，乘数默认为 1 。
 *
 * @alias module:Math.times
 * @since 3.1.0
 * @param {...(number|string)} nums 相乘的数
 * @returns {number} 乘积
 * @example
 *
 * times(3); // 3
 * times(3, 0.6); // 1.8
 * times(3, 0.6, 2); // 3.6
 * times(3, 0.6, 2, 10); // 36
 *
 */
declare function times(...nums: (string | number)[]): number;
export default times;
